void neon_mean_scale(const float* din,
                     float* dout,
                     int size,
                     float * mean,
                     float * scale) {
  float* dout_c0 = dout;
  float* dout_c1 = dout + size;
  float* dout_c2 = dout + size * 2;
  int i = 0;
    // 自己paddleX训练的模型  DeepLabv3+ MobileNetV3_large_x1_ssld
    float a = 127.5f;
    float b = 0.00784313725490196f;
    // 如果是内置的踢足球的例子  a = 0.5f  b = 1.0f
  for (; i < size; i++) {
      *(dout_c0++) = (*(din++) - a) * b;
      *(dout_c1++) = (*(din++) - a) * b;
      *(dout_c2++) = (*(din++) - a) * b;
  }
}
